import React from 'react';
import SavingsGoals from '../components/SavingsGoals';

const SavingsPage = () => {
    return (
        <div className="container">
            <h1>Savings Goals</h1>
            <SavingsGoals />
        </div>
    );
};

export default SavingsPage;
